const myImage = new Image()
myImage.src =
  "data:image/jpeg;base64,";
myImage.addEventListener("load", () => {
  const canvas = document.getElementById("canvas");
  const ctx = canvas.getContext("2d");
  const numberOfParticles = 5000;
  const WIDTH = (canvas.width = 1000);
  const HEIGHT = (canvas.height = 1000);

  function calculateRelativeBrightness(red, green, blue) {
    return Math.sqrt(
      (red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114) / 100
    );
  }

  ctx.drawImage(myImage, 0, 0, WIDTH, HEIGHT);
  const pixels = ctx.getImageData(0, 0, WIDTH, HEIGHT);
  ctx.clearRect(0,0,WIDTH, HEIGHT)

  let particlesArray = [];
  let mappedImage = [];

  for (let y = 0; y < HEIGHT; y++) {
    let row = [];
    for (let x = 0; x < WIDTH; x++) {
      const red = pixels.data[y * 4 * pixels.width + x * 4];
      const green = pixels.data[y * 4 * pixels.width + (x * 4 + 1)];
      const blue = pixels.data[y * 4 * pixels.width + (x * 4 + 2)];
      const brightness = calculateRelativeBrightness(red, green, blue);
      const cell = [(cellBrightness = brightness)];
      row.push(cell);
    }
    mappedImage.push(row);
  }

  console.log(mappedImage)

  class Particle {
    constructor() {
      this.x = Math.random() * WIDTH;
      this.y = Math.random() * HEIGHT;
      this.speed = 0;
      this.velocity = Math.random() * 15;
      this.size = Math.random() * 0.5 + 1
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
    }
    update() {
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
      if (mappedImage[this.position1] && mappedImage[this.position1][this.position2]) {
        this.speed = mappedImage[this.position1][this.position2][0]
      }
      let movement = Math.abs(15 - this.speed + this.velocity);
      this.y += movement;
      if (this.y >= HEIGHT) {
        this.y = 0;
        this.x = Math.random() * WIDTH;
      }
    }
    draw() {
      ctx.beginPath();
      ctx.fillStyle = "white";
      ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
      ctx.fill();
    }
  }
  function init() {
    for (let i = 0; i < numberOfParticles; i++) {
      particlesArray.push(new Particle());
    }
  }
  init();
  function animate() {
    ctx.globalAlpha = 0.01;
    ctx.fillStyle = "black";
    ctx.fillRect(0, 0, WIDTH, HEIGHT);
    ctx.globalAlpha = 0.2
    for (let i = 0; i < particlesArray.length; i++) {
      particlesArray[i].update();
      ctx.globalAlpha = particlesArray[i].speed * 0.5
      particlesArray[i].draw();
    }
    requestAnimationFrame(animate);
  }
  animate();
});